import React from 'react'

function AnimatedRoutes() {
  return (
    <Routes>
        <Route path='/' element={<Instruction/>} />
        <Route path='/game' element={<Home/>} />
        <Route path='*' element={<h1>啊哦，你是不是网不太好……</h1>} />
    </Routes> 
  )
}

export default AnimatedRoutes
